import React from 'react';
import data from './boxoffice2019.json';

let dataProcessing2 = () => {

    fetch("./boxoffice2019.json")
      .then(res => res.json())
      .then(
          (result) => {
              console.log('data', result);
          }
          
      )
}

export default dataProcessing2;
